fields.description:
car emergency kit 9pce


comprehensive kit ideal for most motoring emergencies.

 includes 2m jump leads with copper-coated clamps; 

3m tow rope with steel hooks; 

warning triangle with case (complies with ece27); 

hi-vis safety vest (en471); 

wind-up torch with 3 super-bright leds; 

sturdy, single-barrel foot pump, emergency window sign, 

whistle and ice scraper, packed in sturdy carry case.
